(1, '&#2361;&#2366;&#2350;&#2381;&#2352;&#2379; &#2348;&#2366;&#2352;&#2375;&#2350;&#2366; ', 'about-us ', 'Header', 0, 'Realising the growing importance of information in agricultural development, the Agriculture Information Section (AIS) became operational in 1965 as a separate unit in the Department of Agriculture. This section was renamed as Agriculture Communication Division (ACD) in 1990. In course of restructuring of the Ministry of Agriculture Development in 2000, it was given its current namegkvd w vnoge  Agricultural Information and Communication Center (AICC) and was attached to the Ministry as one of its central wings with greater role and responsibility.<br />', 'Realising the growing importance of information in agricultural development, the Agriculture Information Section (AIS) became operational in 1965 as a separate unit in the Department of Agriculture. This section was renamed as Agriculture Communication Division (ACD) in 1990. In course of restructuring of the Ministry of Agriculture Development in 2000, it was given its current namegkvd w vnoge Agricultural Information and Communication Center (AICC) and was attached to the Ministry as one of its central wings with greater role and responsibility.', 'Normal Group', 11, 'no', '2012-12-11', '', 'normal', 'No', '', '', '', '', '', '', '', '', '', '', '', '', 'about-us', '', 0, '', 0, '', '0', '0', '', '', '', '', '', '', '', ''),
