(156, 'About AICC', 'about-aicc', 'Header', 1, '<strong>Organizational Objectives</strong><br />\r\nTo fulfill the information needs of agricultural practitioners and farm communities through the use of modern information and communication technology.<br />\r\nTo identify, capture, document and disseminate agricultural information and knowledge resources for professionals, stakeholders, producers, processors and traders in easy, transparent and faster ways.<br />\r\nTo motivate farmers and growers using media of mass communication to adopt modern farm practices in order to increase farm productions.<br />\r\n<br />\r\nTo develop networks of agricultural information and communication systems to enhance information sharing within and among stakeholder organizations.<br />\r\nTo help close the digital rift between rich and poor farmers, urban and rural areas through innovative use of ICT in a way to ensure food security, poverty alleviation and sustainable agricultural development.<br />\r\n<br />\r\n<strong>Major Functions</strong><br />\r\n<br />\r\nProduction and broadcast of farm radio programs and agricultural news,<br />\r\nProduction and broadcast of video documentaries, agricultural programs and news from Nepal Television,<br />\r\nPublication and distribution of bimonthly agricultural magazine, diary, calendar, booklet, folder and print works.<br />\r\nAgricultural information collection, documentation, maintaining digital library and website updating.<br />', '<strong>Organizational Objectives</strong><br />\r\n<br />\r\nTo fulfill the  information needs of agricultural practitioners and farm communities  through the use of modern information&nbsp;and communication technology.<br />\r\nTo  identify, capture, document and disseminate agricultural information  and knowledge resources for professionals, stakeholders, producers,  processors and traders in easy, transparent and faster ways.<br />\r\nTo  motivate farmers and growers using media of mass communication to adopt  modern farm practices in order to increase farm productions.<br />\r\n<br />\r\nTo  develop networks of agricultural information and communication systems  to enhance information sharing within and among stakeholder  organizations.<br />\r\nTo help close the digital rift between rich and poor  farmers, urban and rural areas through innovative use of ICT in a way to  ensure food security, poverty alleviation and sustainable agricultural  development.<br />\r\n<br />\r\n<strong>Major Functions</strong><br />\r\n<br />\r\nProduction and broadcast of farm radio programs and agricultural news,<br />\r\nProduction and broadcast of video documentaries, agricultural programs and news from Nepal Television,<br />\r\nPublication and distribution of bimonthly agricultural magazine, diary, calendar, booklet, folder and print works.<br />\r\nAgricultural information collection, documentation, maintaining digital library and website updating.<br />', 'Contents Page', 10, 'no', '2013-11-26', '', 'normal', 'No', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, '', 0, '', '', '', '', '', '', '', '', '', '', ''),
