(158, 'Our Mission and Vision', 'our-mission-and-vision', 'Header', 1, '<strong>Vision</strong><br />\r\n<br />\r\nBuilding an organization driven by information and communication technology (ICT) capable of ensuring timely, faster and relevant access to information to facilitate agricultural stakeholders and practitioners for building knowledge based farm communities.<br />\r\n<br />\r\n<strong>Mission</strong><br />\r\n<br />\r\nServing as a full-fledged Center found on ICT culture to motivate communities to adopt knowledge-based agricultural systems by fostering greater organizational efficiency and interrelationships among farmers, extension workers, researchers and entrepreneurs.<br />', '<strong>Vision</strong><br />\r\n<br />\r\nBuilding an organization driven by  information and communication technology (ICT) capable of ensuring  timely, faster and relevant access to information to facilitate  agricultural stakeholders and practitioners for building knowledge based  farm communities.<br />\r\n<br />\r\n<strong>Mission</strong><br />\r\n<br />\r\nServing as a  full-fledged Center found on ICT culture to motivate communities to  adopt knowledge-based agricultural systems by fostering greater  organizational efficiency and interrelationships among farmers,  extension workers, researchers and entrepreneurs.<br />', 'Contents Page', 20, 'no', '2013-11-26', '', 'normal', 'No', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, '', 0, '', '', '', '', '', '', '', '', '', '', ''),
