(1073, 'Agri Magazine', 'agri-magazine', 'Header', 1009, 'Realising the growing importance of information in agricultural   development, the Agriculture Information Section (AIS) became   operational in 1965 as a separate unit in the Department of Agriculture.   This section was renamed as Agriculture Communication Division (ACD)  in  1990. In course of restructuring of the Ministry of Agriculture   Development in 2000, it was given its current name of Agricultural   Information and Communication Center (AICC) and was attached to the   Ministry as one of its central wings with greater role and   responsibility.<br />\r\n<br />\r\nAICC is a professional wing of the Ministry of  Agriculture Development  entrusted to produce agricultural information  relevant to farmers,  traders, entrepreneurs and professionals and to  communicate the  information through Radio, Television and Print media.  The Center also  bears the additional responsibility and challenge of  managing and using  digital information generated recently by the growing  application of  personal computer, internet and mobile telephone in  modernizing  agricultural development in the country. <br />', 'Realising the growing importance of information in agricultural   development, the Agriculture Information Section (AIS) became   operational in 1965 as a separate unit in the Department of Agriculture.   This section was renamed as Agriculture Communication Division (ACD)  in  1990. In course of restructuring of the Ministry of Agriculture   Development in 2000, it was given its current name of Agricultural   Information and Communication Center (AICC) and was attached to the   Ministry as one of its central wings with greater role and   responsibility.<br />\r\n<br />\r\nAICC is a professional wing of the Ministry of  Agriculture Development  entrusted to produce agricultural information  relevant to farmers,  traders, entrepreneurs and professionals and to  communicate the  information through Radio, Television and Print media.  The Center also  bears the additional responsibility and challenge of  managing and using  digital information generated recently by the growing  application of  personal computer, internet and mobile telephone in  modernizing  agricultural development in the country. <br />', 'Contents Page', 13, 'no', '2015-06-24', 'AICC-iconsmagazine.png', 'normal', 'No', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, '', 0, '', '', '', '', '', '', '', '', '', '', ''),
